Visit us on https://www.facebook.com/alipayglobal/

YOU ARE ONLY A ‘TOUCH’ AWAY- 
1. Send/Receive money from your peers;
2. Transfer money to friends or split the bill at your favorite restaurant;
3. Card free payment at millions of merchants;
4. Top up your mobile phone and pay your utility bills;
5. Place and track orders in Taobao and TMall;
6. Order food from local restaurants or book a taxi;
7. Manage your money with wealth management products;
8. Free off-site cross-bank transfer / credit card repayment and loans;
9. Scan & Pay – Scan & use the QR code to pay at your local stores;
10. Book Air/Rail/Movie Tickets, at ease;
11. Enjoy hundreds of discounts and promotions from various merchants;
12. Group account facility to manage expenses within family and friends circle;
13. Donate/Participate in walkathons along with your friends in "Sports" service which supports HealthKit functionality.

“IAM connect” mobile application is created by the Municipal Affairs Bureau (IAM) of the Government of Macao Special Administrative Region. It mainly offers case report, electronic municipal services, Friends of IAM electronic membership cards, push notification service and other functions.

The content includes:
1. Case report: The public may give their opinions through the application. The dedicated department receives and distributes the cases immediately. Enquiries about the progress or follow-up results of cases can be made via the application;
2. Electronic municipal services: The electronic services of IAM are centralised, including guided tour service, guides on administrative formalities of municipal services, ticket-taking and bookings for IAM services, etc.;
3. Friends of IAM electronic membership card: Friends of IAM members can bind their membership cards in the application and use the facilities in activity centres with the electronic membership cards;
4. Push notification service: Users can receive the latest information about IAM.
